import React, { Component } from "react";
import postscribe from "postscribe";

class Result extends Component {
  render() {
    return postscribe(
      "#mydiv",
      '<div style="width:300px; margin:0; padding:0; border:0;"><iframe src="http://www.budgetyourtrip.com/widgets/countrycostwidget.php?width=300" frameborder="0" border="0" cellspacing="0" style="width: 300px; height: 300px; margin: 0; padding: 0; overflow: hidden; border: 0;"></iframe><div style="font-size: x-small; font-family: Arial, Tahoma, sans-serif; text-align: right; width: 300px;margin:0;padding:0;"><a style="text-decoration: none; color: #999999;" href="http://www.budgetyourtrip.com?r=widget" target="_blank">Budget Your Trip</a></div></div>'
    );
  }
}

export default Result;
